import React from "react";
import "./style.css";
import articleData from "./articledata";
import winexplorertarget from "./png/winexplorertarget.png";
import fileexplorerthispc from ""
import Navbar from "./Navbar";
import Headline from "./Headline";
import Article from "./Article";

class App extends React.Component {
  render() {
    const instructions = articleData[0].instructions.map(item => (
      <li>{item}</li>
    ));

    return (
      <div>
        <Navbar />
        <div id="nav-filler"></div>
        <Headline />
        <Article
          category={articleData[0].category}
          title={articleData[0].title}
          subtitle={articleData[0].subtitle}
          description={articleData[0].description}
          instructions={instructions}
          img={winexplorertarget}
          alt={articleData[0].alt}
        />
        <Article
          category={articleData[1].category}
          title={articleData[1].title}
          subtitle={articleData[1].subtitle}
          description={articleData[1].description}
          instructions={instructions}
          img={winexplorertarget}
          alt={articleData[1].alt}
        />
      </div>
    );
  }
}

export default App;
